public void modifiedField(FieldId _fieldId)
{
    super(_fieldId);
    // <GEECZ> <GEEHU>
    switch (_fieldId)
    {
        case fieldNum(IntrastatParameters, LegalEntityRecId) :
            this.Location = 0; //reset address, since it's dependent on legalEntity
            break;
    }
    // </GEEHU> </GEECZ>
}

public boolean validateField(fieldId _fieldIdToCheck)
{
    #ISOCountryRegionCodes

    boolean ret;

    ret = super(_fieldIdToCheck);

    switch (_fieldIdToCheck)
    {
        case fieldNum(IntrastatParameters, MaxWeight):
            if (this.MaxWeight < 0)
            {
                ret = checkFailed("@SYS91969");
            }
            break;

        case fieldNum(IntrastatParameters, MaxAmount):
            if (this.MaxAmount < 0)
            {
                ret = checkFailed("@SYS300672");
            }
            break;

        case fieldNum(IntrastatParameters, SalesReporting):
            if (SysCountryRegionCode::isLegalEntityInCountryRegion([#isoIT]) && this.SalesReporting == PeriodOfReporting::Year)
            {
                ret = checkFailed("@SYS334987");
            }
            break;

        case fieldNum(IntrastatParameters, PurchReporting):
            if (SysCountryRegionCode::isLegalEntityInCountryRegion([#isoIT]) && this.PurchReporting == PeriodOfReporting::Year)
            {
                ret = checkFailed("@SYS334987");
            }
            break;
    }

    return ret;
}

static boolean exist()
{
    return (select RecId from intrastatParameters).RecId != 0;
}

static IntrastatParameters find(boolean _forUpdate = false)
{
    IntrastatParameters parameter;

    // Return empty record if the configuration key for the table is disabled.
    if (parameter.isTmp())
    {
        return parameter;
    }

    if (_forUpdate)
    {
        parameter.selectForUpdate(true);
    }

    select firstonly parameter
        index Key
        where parameter.Key == 0;

    if (!parameter && !parameter.isTmp())
    {
        Company::createParameter(parameter);
        IntrastatCompressParameters::initiate();
    }

    return parameter;
}

/// <summary>
/// Indicates whether a country context is an Eastern European country.
/// </summary>
/// <returns>
/// true if the country is an Eastern European country; otherwise, false.
/// </returns>
public static boolean isLegalEntityInEEU()
{
    #isoCountryRegionCodes
    container   regionCodes;

    // Eastern Europe Countries
    regionCodes += #isoCZ; // Czech Republic
    regionCodes += #isoEE; // Estonia
    regionCodes += #isoHU; // Hungary
    regionCodes += #isoLT; // Lithuania
    regionCodes += #isoLV; // Latvia
    regionCodes += #isoPL; // Poland

    return SysCountryRegionCode::isLegalEntityInCountryRegion(regionCodes);
}

